import axios from "axios";

export async function getGeoLocationAPI(): number[] {
    // 현재 위치 정보 - 좌표
    const geoLocation:number[] = navigator.geolocation.getCurrentPosition((position) => {
        console.log(typeof(position.coords.latitude))
        return [position.coords.latitude, position.coords.longitude]
      })

      return geoLocation;
}
